import React from 'react'
import './logo.css';

const logo = () => {
    return (
        <a href='#' className='logo'>
            <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/2/26/Beats_Music_logo.svg/767px-Beats_Music_logo.svg.png' className='img-responsive' />
        </a>
    )
}

export default logo
